syntax = "proto3";
package multitenancydashboardservice;
option go_package = "github.com/90poe/ps/back-office-service/api";


import "google/protobuf/wrappers.proto";

// this service will be used for internal communication between services
service BackOfficeService {
	// for frontend app renderer service
	rpc GetFrontendAppConfiguration (GetFrontendAppConfigurationRequest) returns (GetFrontendAppConfigurationResponse);
	// used by auth2 service to get it's configuration
	rpc GetAuthConfigurationBySubDomain (GetAuthConfigurationBySubDomainRequest) returns (GetAuthConfigurationBySubDomainResponse);
	// used by user service to assign roles to group
	rpc GetAllRoles (GetAllRolesRequest) returns (GetAllRolesResponse);
	// used by platform auth service to to get permissions for m2m tenant token
	rpc GetTenantMachineTokenPermissions (GetTenantMachineTokenPermissionsRequest) returns (GetTenantMachineTokenPermissionsResponse);
	// used by platform auth service to to get permissions for m2m internal token
	rpc GetInternalMachineTokenPermissions (GetInternalMachineTokenPermissionsRequest) returns (GetInternalMachineTokenPermissionsResponse);
	// used by m2m idp for ensure service token really exist
	rpc VerifyMachineToken (VerifyMachineTokenRequest) returns (VerifyMachineTokenResponse);
	// used by services to fetch basic tenant details
	rpc GetAllTenants(GetAllTenantsRequest) returns (GetAllTenantsResponse);
	// used to create a new tenant
	rpc CreateTenant(CreateTenantRequest) returns (TenantResponse);
	// used to get tenant
	rpc GetTenant(GetTenantRequest) returns (TenantResponse);
	// used to delete a tenant
	rpc DeleteTenant(DeleteTenantRequest) returns (DeleteTenantResponse);
	// used to update a tenant
	rpc UpdateTenant(UpdateTenantRequest) returns (TenantResponse);
}

message GetFrontendAppConfigurationRequest {
}

message GetFrontendAppConfigurationResponse {
	FrontendApp app = 1;
}

message GetAuthConfigurationBySubDomainRequest {
	string sub_domain = 1;
}

message GetAuthConfigurationBySubDomainResponse {
	google.protobuf.StringValue config = 1;
}

message GetAllRolesRequest {
}

message GetAllRolesResponse {
	repeated Role roles = 1;
}

message GetTenantMachineTokenPermissionsRequest {
	string client_id = 1;
	string account_id = 2;
}

message GetTenantMachineTokenPermissionsResponse {
	repeated string permissions = 1;
}

message GetInternalMachineTokenPermissionsRequest {
	string client_id = 2;
}

message GetInternalMachineTokenPermissionsResponse {
	repeated string permissions = 1;
}

message VerifyMachineTokenRequest {
	string client_id = 2;
	string client_secret = 3;
}

message VerifyMachineTokenResponse {
	MachineTokenType type = 1;
	repeated string accounts = 2;
}

message Role {
	string id = 1;
	string name = 2;
	string label = 3;
	google.protobuf.StringValue description = 4;
	repeated Permission permissions = 5;
}

message Permission {
	string resource = 1;
	repeated AccessLevel access_levels = 2;
	string resource_description = 3;
}

message GetAllTenantsRequest {
}

message GetTenantRequest {
	string id = 1;
}

message DeleteTenantRequest {
	string id = 1;
}

message DeleteTenantResponse {
}

message CreateTenantRequest {
	string name = 1;
	string sub_domain = 2;
	string account_id = 3;
}

message UpdateTenantRequest {
	string id = 1;
	string name = 2;
	string sub_domain = 3;
	string account_id = 4;
}

message TenantResponse {
	string id = 1;
	string name = 2;
	string sub_domain = 3;
	string account_id = 4;
}

message GetAllTenantsResponse {
	repeated Tenant tenants = 1;
}

message Tenant {
	string account_id = 2;
	string name = 3;
	string subdomain = 4;
}

enum AccessLevel {
	READ = 0;
	UPDATE = 1;
	DOWNLOAD = 2;
	CREATE = 3;
	DELETE = 4;
	LIST = 5;
}

enum MachineTokenType {
	INTERNAL = 0;
	TENANT = 1;
}

message FrontendApp {
	string root_url_prefix = 1;
	bool maintenance = 2;
	string config = 3;
	string support_config = 4;
}

syntax = "proto3";
package contactsservice;
option go_package = "github.com/90poe/ps/contacts-domain-service/api";

import "google/protobuf/timestamp.proto";
import "google/protobuf/wrappers.proto";

message Address {
    string country_iso_code = 1;
    string city = 2;
    string postcode = 3;
    string address_line_1 = 4;
    string address_line_2 = 5;
    string address_line_3 = 6;
    string address_line_4 = 7;
    string address_line_5 = 8;
    string state = 9;
}

message UnprivilegedAddress {
    string country_iso_code = 1;
    string city = 2;
    string postcode = 3;
    string address_line_1 = 4;
}

message Company {
    string id = 1;
    string name = 2;
    Address address = 3;
    repeated Contact contacts = 4;
    bool archived = 5;
    repeated CompanyCompanyType company_types = 6;
    Category category = 7;
    repeated Company affiliates = 8 [deprecated=true];
    string parent_company_id = 9;
    bool active = 10 [deprecated=true];
    repeated string port_ids = 11 [deprecated=true];
    CompanyPorts company_ports = 20 [deprecated=true];
    string email = 12;
    string phone = 13;
    string website1 = 14;
    string website2 = 15;
    bool operates_worldwide = 16;
    string short_name = 17;
    bool delisted = 18;
    google.protobuf.Timestamp updated_at = 19;
    string updated_by = 21;
    google.protobuf.DoubleValue longitude = 22;
    google.protobuf.DoubleValue latitude = 23;
    CompanyOperationLocations company_operation_locations = 24;
}

message UnprivilegedCompany {
    string id = 1;
    string name = 2;
    UnprivilegedAddress address = 3;
    string email = 4;
    string phone = 5;
}

message CompanyPorts {
    repeated string port_ids = 1;
    string updated_by = 2;
    google.protobuf.Timestamp updated_at = 3;
}

message CompanyOperationLocations {
    repeated string operation_location_ids = 1;
    string updated_by = 2;
    google.protobuf.Timestamp updated_at = 3;
}

enum Category {
    PARENT = 0;
    AFFILIATE = 1;
}

message ContactMethod {
    string id = 1;
    string type = 2;
    string value = 3;
}

message Contact {
    string id = 1;
    string label = 2;
    repeated ContactMethod contact_methods = 3;
    bool archived = 4;
    string company_id = 5;
    string department = 6;
}

message ContactMethodWithContact {
    string id = 1;
    string type = 2;
    string value = 3;
    string contact_id = 4;
    string label = 5;
    bool archived = 6;
    string company_id = 7;
    string department = 8;
}

message CompanyCompanyType {
    string id = 1;
    string company_type_id = 2;
    string name = 3;
}

message CompanyType {
    string id = 1;
    string name = 2;
}

message Filter {
    string field = 1;
    string action = 2;
    repeated string value = 3;
}

message OrderBy {
    string field = 1;
    string direction = 2;
}

message GetCompaniesRequest {
    int64 limit = 1;
    int64 offset = 2;
    repeated Filter filters = 3;
    OrderBy order_by = 4;
    google.protobuf.StringValue search_term = 5;
}

message Pagination {
    int64 limit = 1;
    int64 offset = 2;
    int64 total = 3;
}

message GetCompaniesResponse {
    repeated Company companies = 1;
    Pagination pagination = 2;
}

message UnprivilegedCompaniesResponse {
    repeated UnprivilegedCompany companies = 1;
    Pagination pagination = 2;
}

message GetCompanyRequest {
    string id = 1;
}

message GetCompanyResponse {
    Company company = 1;
}

message UnprivilegedCompanyResponse {
    UnprivilegedCompany company = 1;
}

message GetContactMethodWithContactRequest {
    string id = 1;
}

message GetContactMethodWithContactResponse {
    ContactMethodWithContact contact = 1;
}

message GetContactRequest {
    string id = 1;
}

message GetContactResponse {
    Contact contact = 1;
}

message GetCompanyTypesResponse {
    repeated CompanyType company_types = 1;
}

message CreateCompanyResponse {
    Company company = 1;
}

message CreateCompanyRequest {
    Company company = 1;
}

message UpdateCompanyResponse {
    Company company = 1;
}

message UpdateCompanyRequest {
    string id = 1;
    Company company = 2;
}

message ArchiveCompanyResponse {
    Company company = 1;
}

message ArchiveCompanyRequest {
    string id = 1;
    bool state = 2;
}

message CreateContactResponse {
    Contact contact = 1;
}

message CreateContactRequest {
    Contact contact = 1;
}

message UpdateContactResponse {
    Contact contact = 1;
}

message UpdateContactRequest {
    string id = 1;
    Contact contact = 3;
}

message ArchiveContactResponse {
    Contact contact = 1;
}

message ArchiveContactRequest {
    string id = 1;
    bool state = 2;
}

message Empty {
}

message CompanyPortsRequest {
    string company_id = 1;
    repeated string ports = 2;
}

message CompanyOperationLocationsRequest {
    string company_id = 1;
    repeated string operation_location_ids = 2;
}

message Country {
    string name = 2;
    string nationality = 3;
    string iso_alpha_2 = 4;
    string iso_alpha_3 = 5;
}

message Countries {
    repeated Country countries = 1;
}

message GetCountryRequest {
    string iso_code = 1;
}

message GetCountriesRequest {
    repeated string iso_codes = 1;
}

message SearchCountriesResponse {
	Countries countries = 1;
}

message SearchCountriesRequest {
	string term = 1;
	int32 limit = 2;
	bool additionally_search_by_iso2_codes = 3;
}

message GetAllCountriesRequest {}

service ContactsService {
    rpc GetCompanies (GetCompaniesRequest) returns (GetCompaniesResponse);
    rpc GetUnprivilegedCompanies (GetCompaniesRequest) returns (UnprivilegedCompaniesResponse);
    rpc GetCompany (GetCompanyRequest) returns (GetCompanyResponse);
    rpc GetUnprivilegedCompany (GetCompanyRequest) returns (UnprivilegedCompanyResponse);
    rpc GetContact (GetContactRequest) returns (GetContactResponse);
    rpc GetContactMethodWithContact (GetContactMethodWithContactRequest) returns (GetContactMethodWithContactResponse);
    rpc GetCompanyTypes (Empty) returns (GetCompanyTypesResponse);
    rpc CreateCompany (CreateCompanyRequest) returns (CreateCompanyResponse);
    rpc UpdateCompany (UpdateCompanyRequest) returns (UpdateCompanyResponse);
    rpc ArchiveCompany (ArchiveCompanyRequest) returns (ArchiveCompanyResponse);
    rpc CreateContact (CreateContactRequest) returns (CreateContactResponse);
    rpc UpdateContact (UpdateContactRequest) returns (UpdateContactResponse);
    rpc ArchiveContact (ArchiveContactRequest) returns (ArchiveContactResponse);
    rpc AddCompanyPorts (CompanyPortsRequest) returns (GetCompanyResponse){
        option deprecated = true;
    };
    rpc AddCompanyOperationLocations (CompanyOperationLocationsRequest) returns (GetCompanyResponse);
    rpc RemoveCompanyOperationLocations (CompanyOperationLocationsRequest) returns (GetCompanyResponse);
    rpc RemoveCompanyPorts (CompanyPortsRequest) returns (GetCompanyResponse){
        option deprecated = true;
    };
    rpc GetCountry (GetCountryRequest) returns (Country);
    rpc GetCountries (GetCountriesRequest) returns (Countries);
    rpc GetAllCountries (GetAllCountriesRequest) returns (Countries);
    rpc SearchCountries (SearchCountriesRequest) returns (SearchCountriesResponse);

}
